import mongoose, { Mongoose } from "mongoose";

const UserSchema = new mongoose.Schema({
        name:{
            type:String,
            required :true
        },
        email :{
            type:String,
            required:true,
            unique:true
        },
        image:{
                type:String,
                default:"data:image/png;base64,",
        },
        password:{
            type:String,
            default:''
        },
        gender:{
            type:String,
            default: "Not Selected"
        },
        dob:{
            type:String,
            default:"0000-00-00",
        },
        phone:{
            type:String,
            default:"0000000000"
        },
        address:{
            type:String,
            default:""
        }
}, {minimize:false})
const UserModel  = mongoose.models.user || mongoose.model('user',UserSchema);
export default UserModel